import "./share.css"

const Share = () => {
  return (
    <div className="share">
        <div className="shareTop">
            <img className="shareProfileImg" src="/assets/person/1.jpeg" alt="" />
            <input placeholder="What's on your mind?" className="shareInput" />
        </div>
        <div className="shareBottom"></div>
    </div>
  )
}

export default Share
